edition = "2023";

package youtube.elements.queries;

import "youtube/elements/queries/data_source_config.proto";

option java_package = "com.google.protos.youtube.elements.queries";
option java_multiple_files = true;
option cc_enable_arenas = true;
option objc_class_prefix = "ELMQY";

message Type {
	int32 type_id = 1;
	bool is_repeated = 3;
	string message_type = 4;
	string enum_type = 5;
	DataSourceConfig data_source_config = 6;
}
